import React, {Component} from "react";
import "./allPosts.css";
class ShowPosts extends Component{
    render(){
        return(
            <section className ="post-section">
                <h2 style={{marginLeft:"50px"}}>See all posts Here</h2>
            </section>
        )
    }
}
export default ShowPosts;
